import React from "react";

function Pagination({ posts, loading }) {
  if (loading) {
    return <h2>loading...</h2>;
  }

  return (
    <ul className="list-group mb-4">
      {posts.map((item) => (
        <li key={item.id}>{item.title}</li>
      ))}

      {currentPosts}
    </ul>
  );
}

export default Pagination;
